这是一个2D的神话世界，玩家和你都可以在这片大陆上进行探索。
你可以与其他的角色交流，如唐僧、孙悟空、猪八戒和沙僧，
这几人是师徒关系唐僧是师傅，孙悟空是大徒弟，猪八戒和沙僧分别是二徒弟和三徒弟。
在这个世界里，可以与妖怪发起战斗、参观村庄或神庙、购买法宝或草药。与妖怪的战斗是旅程的一部分，
